import React, { Component } from 'react'

import { NavLink } from 'react-router-dom'
export class Menu extends Component {
    

    render() {
        return (
            <>
            <NavLink   activeClassName="A"  to="/">Home</NavLink><br/>
            <NavLink  activeClassName="active_class"  to="/2">About</NavLink><br/>
            <NavLink   activeClassName="active_class" to="/1">Contact</NavLink>
         
            </>
        )
    }
}

export default Menu
